    <div>
      <h3>{data.name}</h3>
      <p>{data.species}</p>
    </div>

    </div>))}
return(
        <div>
            <Head>
                <title>About</title>
            </Head>
        <Navigation/>
        <h1>About</h1>

        </div>
    )
}
